import React from "react";
import "./PlansComponent.css";

function PlansComponent({ type, res, isCurrent = false }) {
  return (
    <div className="plans">
      <div className="plans__info">
        <h1>Netflix {type}</h1>
        <h2>{res}</h2>
      </div>
      {!isCurrent ? (
        <button className="plans__button">Subscribe</button>
      ) : (
        <button className="plans__current">Current Package</button>
      )}
    </div>
  );
}

export default PlansComponent;
